import React,{Component} from 'react';
import { Image,Carousel } from 'react-bootstrap';
import Carouseldiv from './Home/Carousel';
class Home extends Component{
    render(){
        return(
            <React.Fragment>
                <Carouseldiv />
            </React.Fragment>
        );
    }
}

export default Home;
